import './App.css';

import React from "react"
import {Routes, Route} from "react-router-dom";
import Header from "./components/Header"
import Photos from "./pages/Photos";
import Cart from "./pages/Cart";

function App() {
    return (
        <div>
            <Header/>
            <Routes>
                <Route exact path = "/">
                    <Photos />
                </Route>
                <Route exact path = "/cart">
                    <Cart />
                </Route>
            </Routes>
            <h1>Home Page</h1>
        </div>

    )
}

export default App
